# Setting Up Web Push Notifications for Safari on iOS 16.4+

Here's a comprehensive guide for implementing web push notifications on Safari iOS 16.4+ (current as of 2025):

## Key Requirements

### 1. **iOS/iPadOS Version**
- **iOS 16.4+** or **iPadOS 16.4+** required
- iOS 17+ has enhanced support with better API implementation

### 2. **PWA Installation Required**
Unlike desktop Safari, **web push ONLY works for Progressive Web Apps (PWAs) added to the Home Screen**. Regular Safari browsing does not support push notifications.

### 3. **Browser Support**
Works on Safari, Chrome, and Edge on iOS/iPadOS 16.4+

## Implementation Steps

### 1. **Create a Web App Manifest (`manifest.json`)**

This is **mandatory** for iOS web push support:

```json
{
  "name": "Your App Name",
  "short_name": "App",
  "display": "standalone",
  "start_url": "/",
  "id": "/",
  "theme_color": "#000000",
  "background_color": "#ffffff",
  "icons": [
    {
      "src": "/icon-192x192.png",
      "sizes": "192x192",
      "type": "image/png"
    },
    {
      "src": "/icon-512x512.png",
      "sizes": "512x512",
      "type": "image/png"
    }
  ]
}
```

**Critical:** `display` must be set to `"standalone"` or `"fullscreen"` for iOS push support.

### 2. **Serve Over HTTPS**
Your entire site must use HTTPS.

### 3. **Implement Service Worker**

```javascript
// Register service worker
if ('serviceWorker' in navigator) {
  navigator.serviceWorker.register('/service-worker.js')
    .then(registration => console.log('Service Worker registered'))
    .catch(error => console.log('Service Worker registration failed:', error));
}
```

### 4. **Request Permission (User-Initiated)**

**Important:** Permission request must happen in response to a **direct user interaction** (click, tap):

```javascript
// Must be triggered by user action (e.g., button click)
subscribeButton.addEventListener('click', async () => {
  const permission = await Notification.requestPermission();

  if (permission === 'granted') {
    // Get push subscription
    const registration = await navigator.serviceWorker.ready;
    const subscription = await registration.pushManager.subscribe({
      userVisibleOnly: true,
      applicationServerKey: 'YOUR_VAPID_PUBLIC_KEY'
    });

    // Send subscription to your server
    await sendSubscriptionToServer(subscription);
  }
});
```

### 5. **Handle Push Events in Service Worker**

```javascript
// service-worker.js
self.addEventListener('push', event => {
  const data = event.data.json();

  event.waitUntil(
    self.registration.showNotification(data.title, {
      body: data.body,
      icon: data.icon,
      badge: data.badge,
      data: data.url
    })
  );
});

self.addEventListener('notificationclick', event => {
  event.notification.close();
  event.waitUntil(
    clients.openWindow(event.notification.data)
  );
});
```

## User Flow

For notifications to work, users must:

1. Visit your website in Safari/Chrome/Edge on iOS
2. Tap the **Share** icon
3. Select **"Add to Home Screen"**
4. **Open the installed app** from their home screen
5. Tap your subscribe button to trigger permission request
6. Grant notification permission

## Important Considerations

- **No Browser Context**: Push only works in the installed PWA, not in Safari browser
- **User Gesture Required**: Permission must be requested from a click/tap handler
- **Standard APIs**: Uses standard Push API, Notification API, and Service Workers
- **VAPID Keys**: You'll need to generate VAPID keys for authentication
- **Server Setup**: Your backend needs to support Web Push Protocol

## Validation & Testing

- Use Chrome Lighthouse to validate PWA requirements
- Test the full flow: install → open → subscribe → send test notification
- Monitor delivery rates (some users report intermittent reliability issues)

## Sources:

- [Sending web push notifications in web apps and browsers | Apple Developer Documentation](https://developer.apple.com/documentation/usernotifications/sending-web-push-notifications-in-web-apps-and-browsers)
- [Web Push for Web Apps on iOS and iPadOS | WebKit](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/)
- [iOS web push setup - OneSignal](https://documentation.onesignal.com/docs/en/web-push-for-ios)
- [Setup Web Push Notifications on iOS and iPadOS for Safari - PushAlert](https://pushalert.co/documentation/ios-web-push)
- [Safari Web Push for iOS and iPadOS – Developer Guide](https://developers.moengage.com/hc/en-us/articles/13906923326100-Safari-Web-Push-for-iOS-and-iPadOS)
- [Web Push with Mobile Safari (iOS 16.4) made easy - pwa.io](https://pwa.io/articles/web-push-with-ios-safari-16-4-made-easy)

